import React from "react";
import { arrowFunctionExpression } from "@babel/types";
import {
    ResponsiveContainer,
    PieChart,
    Tooltip,
    Pie,
    Legend,
    Label
} from "recharts";
export default class NavnTable extends React.Component {
    constructor(props) {
        super(props);
        this.renderlist = this.renderlist.bind(this);
    }

    renderlist() {
        console.log(this.props);
        return (
            <ul id="listview2">
                {this.props.navn.map(navn => (
                    <li key={2}>{navn}</li>
                ))}
            </ul>
        );
    }
    render() {
        let data01 = [
            { name: "Group A", value: 2400 },
            { name: "Group B", value: 4567 },
            { name: "Group C", value: 1398 },
            { name: "Group D", value: 9800 },
            { name: "Group E", value: 3908 },
            { name: "Group F", value: 4800 }
        ];
        try {
            console.log(this.props.utgifter[0].navn);
            data01[0].name = "hei";

            data01.append({ name: "yo", value: 200 });
            console.log(data01);
            for (let item in this.props) {
                console.log(item);
            }
        } catch {
            console.log("heisann");
        }

        try {
            return (
                <div>
                    <PieChart width={400} height={400}>
                        <Pie
                            isAnimationActive={false}
                            data={data01}
                            cx={200}
                            cy={200}
                            outerRadius={80}
                            fill="#8884d8"
                            label
                        />
                        <Tooltip />
                    </PieChart>

                    <Tooltip />
                </div>
            );
        } catch {
            return <p> heii</p>;
        }
    }
}
